import React, { useState } from 'react';
import './App.css';
import TimeBlockingCalendar from './components/TimeBlocking/TimeBlockingCalendar';
import PomodoroTimer from './components/Pomodoro/PomodoroTimer';
import DailyTaskList from './components/TaskList/DailyTaskList';
import RecurringTasks from './components/RecurringTasks/RecurringTasks';
import MonthlyBoard from './components/MonthlyBoard/MonthlyBoard';

function App() {
  const [activeComponent, setActiveComponent] = useState('timeBlocking');
  const [expandedFeatures, setExpandedFeatures] = useState({
    timeBlocking: true,
    pomodoro: false,
    taskList: false,
    recurringTasks: false,
    monthlyBoard: false
  });
  const [isSidebarCollapsed, setIsSidebarCollapsed] = useState(false);

  const navItems = [
    {
      id: 'timeBlocking',
      label: 'Time Blocking',
      icon: 'ðŸ“…',
      description: 'Schedule your time effectively'
    },
    {
      id: 'pomodoro',
      label: 'Pomodoro Timer',
      icon: 'â±ï¸',
      description: 'Focus on your work'
    },
    {
      id: 'taskList',
      label: 'Daily Task List',
      icon: 'ðŸ“',
      description: 'Manage your daily tasks'
    },
    {
      id: 'recurringTasks',
      label: 'Recurring Tasks',
      icon: 'ðŸ”„',
      description: 'Set up repeating tasks'
    },
    {
      id: 'monthlyBoard',
      label: 'Monthly Board',
      icon: 'ðŸ“Š',
      description: 'View all projects and tasks'
    }
  ];

  const toggleFeature = (featureId) => {
    setExpandedFeatures(prev => ({
      ...prev,
      [featureId]: !prev[featureId]
    }));
  };

  const toggleSidebar = () => {
    setIsSidebarCollapsed(!isSidebarCollapsed);
  };

  return (
    <div className="App">
      <nav className={`main-nav ${isSidebarCollapsed ? 'collapsed' : ''}`}>
        <div className="nav-header">
          <h1>Time Management</h1>
          <button className="toggle-sidebar-button" onClick={toggleSidebar}>
            {isSidebarCollapsed ? 'â–¶' : 'â—€'}
          </button>
        </div>
        <div className="nav-items">
          {navItems.map(item => (
            <div key={item.id} className="nav-item-container">
              <button
                className={`nav-item ${activeComponent === item.id ? 'active' : ''}`}
                onClick={() => setActiveComponent(item.id)}
              >
                <span className="nav-icon">{item.icon}</span>
                {!isSidebarCollapsed && (
                  <div className="nav-content">
                    <span className="nav-label">{item.label}</span>
                    <span className="nav-description">{item.description}</span>
                  </div>
                )}
              </button>
              {!isSidebarCollapsed && (
                <button 
                  className="expand-button"
                  onClick={() => toggleFeature(item.id)}
                >
                  {expandedFeatures[item.id] ? 'â–¼' : 'â–¶'}
                </button>
              )}
            </div>
          ))}
        </div>
      </nav>
      <main className="main-content">
        <div className="features-container">
          {expandedFeatures.timeBlocking && (
            <div className="feature-section">
              <h2>Time Blocking Calendar</h2>
              <TimeBlockingCalendar />
            </div>
          )}
          
          {expandedFeatures.pomodoro && (
            <div className="feature-section">
              <h2>Pomodoro Timer</h2>
              <PomodoroTimer />
            </div>
          )}
          
          {expandedFeatures.taskList && (
            <div className="feature-section">
              <h2>Daily Task List</h2>
              <DailyTaskList />
            </div>
          )}
          
          {expandedFeatures.recurringTasks && (
            <div className="feature-section">
              <h2>Recurring Tasks</h2>
              <RecurringTasks />
            </div>
          )}
          
          {expandedFeatures.monthlyBoard && (
            <div className="feature-section">
              <h2>Monthly Board</h2>
              <MonthlyBoard />
            </div>
          )}
        </div>
      </main>
    </div>
  );
}

export default App;
